CREATE TABLE IF NOT EXISTS "OFFICES" 
   (            "OFFICE_SEQ_ID" NUMBER(10,0) NOT null, ENABLE, 
                "OFFICE_TYPE_CODE" VARCHAR2(20 BYTE), 
                "PROGRAM_AREA_CODE" VARCHAR2(20 BYTE), 
                "TIME_ZONE_CODE" VARCHAR2(20 BYTE), 
                "ACTIVE_IND" VARCHAR2(1 BYTE) NOT null, ENABLE, 
                "OFFICE_CODE" VARCHAR2(5 BYTE) NOT null, ENABLE, 
                "OFFICE_NAME" VARCHAR2(80 BYTE) NOT null, ENABLE, 
                "LOCATION_DESC" VARCHAR2(250 BYTE), 
                "PHONE_NBR" VARCHAR2(10 BYTE), 
                "FAX_NBR" VARCHAR2(10 BYTE), 
                "CREATE_DTTM" DATE NOT null, ENABLE, 
                "CREATE_USER" VARCHAR2(30 BYTE) NOT null, ENABLE, 
                "UPDATE_DTTM" DATE NOT null, ENABLE, 
                "UPDATE_USER" VARCHAR2(30 BYTE) NOT null, ENABLE, 
                "DAYLIGHT_SAVINGS_IND" VARCHAR2(1 BYTE), 
                "ACTIVE_DATE" DATE, 
                "INACTIVE_DATE" DATE, 
                "PARENT_OFFICE_SEQ_ID" NUMBER(10,0) NOT null, DISABLE, 
                "AUTH_FOR_SIMPLIFIED_PROC_IND" CHAR(1 BYTE)
   ) SEGMENT CREATION IMMEDIATE 
  PCTFREE 10 PCTUSED 40 INITRANS 1 MAXTRANS 255 
 ROW STORE COMPRESS ADVANCED LOGGING
  STORAGE(INITIAL 65536 NEXT 1048576 MINEXTENTS 1 MAXEXTENTS 2147483645
  PCTINCREASE 0 FREELISTS 1 FREELIST GROUPS 1
  BUFFER_POOL DEFAULT FLASH_CACHE DEFAULT CELL_FLASH_CACHE DEFAULT);
ALTER TABLE "OFFICES" ADD CONSTRAINT "OFFICE_DAYLIGHT_SAVINGS_CK" CHECK (daylight_savings_ind in ('Y','N')) ENABLE;
ALTER TABLE "OFFICES" ADD CONSTRAINT "OFFICE_PK" PRIMARY KEY ("OFFICE_SEQ_ID")
  USING INDEX PCTFREE 10 INITRANS 2 MAXTRANS 255 COMPUTE STATISTICS 
  STORAGE(INITIAL 65536 NEXT 1048576 MINEXTENTS 1 MAXEXTENTS 2147483645
  PCTINCREASE 0 FREELISTS 1 FREELIST GROUPS 1
  BUFFER_POOL DEFAULT FLASH_CACHE DEFAULT CELL_FLASH_CACHE DEFAULT);
ALTER TABLE "OFFICES" ADD CONSTRAINT "OFFICE_OFFICE_CODE_UK" UNIQUE ("OFFICE_CODE")
  USING INDEX PCTFREE 10 INITRANS 2 MAXTRANS 255 COMPUTE STATISTICS 
  STORAGE(INITIAL 65536 NEXT 1048576 MINEXTENTS 1 MAXEXTENTS 2147483645
  PCTINCREASE 0 FREELISTS 1 FREELIST GROUPS 1
  BUFFER_POOL DEFAULT FLASH_CACHE DEFAULT CELL_FLASH_CACHE DEFAULT);
ALTER TABLE "OFFICES" ADD CONSTRAINT "OFFICE_ROOT_OFFICE_CK" CHECK (decode(office_seq_id,40050,'Root','NonRoot')||decode(parent_office_seq_id,null,'WithNoParent','WithParent') in ('RootWithNoParent','NonRootWithParent')) ENABLE;
ALTER TABLE "OFFICES" ADD CONSTRAINT "OFFICE_ACTIVE_CK" CHECK (active_ind in ('Y','N')) ENABLE;
ALTER TABLE "OFFICES" ADD CONSTRAINT "AUTH_FOR_SIMP_PROC_IND_CK" CHECK (AUTH_FOR_SIMPLIFIED_PROC_IND in ('Y','N')) ENABLE;
